import Navbar from "./components/Navbar/Navbar";

function App() {
  return (
    <div>
      <Navbar />
      <Switch>
        <Route exact path='/' component={Home} />
        <Route path='/work' component={Work} />
        <Route path='/study' component={Study} />
        <Route path='/other' component={Other} />
      </Switch>
    </div>
  );
}

export default App;
